const Filter= () => {
  return (
  

    <React.Fragment >
      <Container fixed style={{backgroundColor:"blue",display:'flex',justifyContent:'start',marginTop:'10px',height:'600px',width:'40vh'}} >
        <box ><h1>Filter</h1></box>
      </Container>
    </React.Fragment>






  )
}

export default Filter
